    <div class="row">
      <div class="col-xs-12 col-xs-12 col-lg-12">
        <div class="card">
        <img src={resume} className="fitness" alt ="Screenshot of fitness app" />
          <div class="card-block">
            <h4 class="card-title">Fitness Pal</h4>
